import {Component} from 'react'

import './index.css'

class LettersCalculator extends Component {
  state = {
    inputPhrase: '',
  }

  onChangeInputPhrase = event => {
    const {value} = event.target

    this.setState({inputPhrase: value})
  }

  render() {
    const {inputPhrase} = this.state

    return (
      <div className="letter-calc-cont">
        <div className="counter-part">
          <h1 className="calc-head">Calculate the Letters you enter</h1>
          <label htmlFor="phraseText" className="calc-title">
            Enter the phrase
          </label>
          <input
            type="text"
            id="phraseText"
            placeholder="Enter the phrase"
            className="phrase-input"
            onChange={this.onChangeInputPhrase}
            value={inputPhrase}
          />
          <p className="calc-button">No.of letters: {inputPhrase.length}</p>
        </div>
        <img
          alt="letters calculator"
          className="calc-image"
          src="data:image/png;base64,"
        />
      </div>
    )
  }
}
export default LettersCalculator
